import React from 'react'
import Blog from '../Components/Blog';
import Footer from '../Components/Footer';
import Header from '../Components/Header';

const Landingpage = () => {
  return (
      <div>
          <div>Landing page</div>
          <Header/>
          <Blog/>
          <Blog/>
          <Blog/>
          <Footer/>         
            
      </div>
    
  )
}

export default Landingpage;
